const styles = (theme) => ({
    rootTree: {
        display: 'flex',
        alignItems: 'center',
    },
    nameCol: {
        flex: '0.8',
        fontWeight: 'inherit',
        flexGrow: 1
    },
    dateColumn: {
        flex: '0.4'
    }
});

export default styles;
